import styled from 'styled-components';
import Grid from "../../Grid";
import GameSettings from "../GameSettings";

const GameBlock = styled.div `
    display: flex;
    flex-direction: column;
    ${GameSettings} {
        background: #ff00ff;
    };
    ${Grid} {
        background: #ff00ff;
    };
`;

const WinnersBlock = styled.div `
    background-color: #4c4c4b;
`;

export {GameBlock}
